		public double obtenerCalidadFuncionalidad(List<double> valores)
		{
			if(_fsCalidadCaracteristicaFuncionalidad == null)
			{
				_fsCalidadCaracteristicaFuncionalidad = SistemaCalidadCaracteristicaFuncionalidad();
				if(_fsCalidadCaracteristicaFuncionalidad == null)
				{
					return -1;
				}
			}

			//Antecedentes
			FuzzyVariable fvAdecuacion = _fsCalidadCaracteristicaFuncionalidad.InputByName("adecuacion");
			FuzzyVariable fvExactitud = _fsCalidadCaracteristicaFuncionalidad.InputByName("exactitud");
			FuzzyVariable fvInteroperabilidad = _fsCalidadCaracteristicaFuncionalidad.InputByName("interoperabilidad");
			FuzzyVariable fvSeguridad = _fsCalidadCaracteristicaFuncionalidad.InputByName("seguridad");
			FuzzyVariable fvCumpFuncionalidad = _fsCalidadCaracteristicaFuncionalidad.InputByName("cumplimiento_funcional");

			//Consecuente
			FuzzyVariable fvFuncionalidad = _fsCalidadCaracteristicaFuncionalidad.OutputByName("funcionalidad");


			Dictionary<FuzzyVariable, double> inputValues = new Dictionary<FuzzyVariable, double>();
			inputValues.Add(fvAdecuacion, valores[0]);
			inputValues.Add(fvExactitud, valores[1]);
			inputValues.Add(fvInteroperabilidad, valores[2]);
			inputValues.Add(fvSeguridad, valores[3]);
			inputValues.Add(fvCumpFuncionalidad, valores[4]);

			Dictionary<FuzzyVariable, double> resultado = _fsCalidadCaracteristicaFuncionalidad.Calculate(inputValues);

			if (resultado[fvFuncionalidad].ToString("f1").Equals("NeuN"))
			{
				Console.WriteLine("Valor de calidad funcionalidad es incorrecto");
				return -1;
			} else
			{
				return resultado[fvFuncionalidad];
			}
		}

